import React from "react";

const Icon = ({ icon, color, size }) => {
    const iconStyle = {
        color: color || "",
        fontSize: size || "1em",
    };

    // 아이콘 컴포넌트를 반환합니다.
    return React.createElement(icon, { style: iconStyle });
};

export default Icon;
